import { useEffect, useState } from "react";
import "./Accordion/Accordion.css";
import MYCONSTANT from "../constant/constant";
import JSONPretty from "react-json-pretty";
var JSONPrettyMon = require("react-json-pretty/dist/monikai");

export default function Paths(props) {
  const [path, setPath] = useState([]);
  const [pathSelected, setPathSelected] = useState(null);
  const [flag, setFlag] = useState(true);

  useEffect(() => {
    setPath(props?.path);
  }, [props]);

  const pathToggle = (i) => {
    if (pathSelected === i) {
      return setPathSelected(null);
    }
    setPathSelected(i);
  };

  const getFlag = () => {
    setFlag(!flag);
  };

  const setMethodColor = (m, border, bg) => {
    if (border && border) {
      return m === MYCONSTANT.POST
        ? "bg-green-" + bg + " border-green-" + border
        : m === MYCONSTANT.PUT
        ? "bg-orange-" + bg + " border-orange-" + border
        : m === MYCONSTANT.GET
        ? "bg-sky-" + bg + " border-sky-" + border
        : "bg-red-" + bg + " border-red-" + border;
    }
    return m === MYCONSTANT.POST
      ? "border-green-" + border
      : m === MYCONSTANT.PUT
      ? "border-orange-" + border
      : m === MYCONSTANT.GET
      ? "border-sky-" + border
      : "border-red-" + border;
  };
 
  const changeResponse=(v)=>{
    console.log(v);
  }
  
  return (
    <>
      {Object.entries(path).map((data, i) =>
        Object.entries(data[1])?.map((method, k) =>
          props.tagName.name === method[1].tags[0] ? (
            <div
              className={`border my-2 rounded-lg ${setMethodColor(
                method[0],
                "300",
                0
              )}`}
              kay={i}
            >
              <div
                className={`flex p-2 border text-black rounded-t-lg ${setMethodColor(
                  method[0],
                  "300",
                  "200"
                )}`}
                onClick={() => pathToggle(i)}
              >
                <div>
                  <span
                    className={` font-bold text-white py-1 px-4 rounded-sm uppercase ${setMethodColor(
                      method[0],
                      "500",
                      "400"
                    )}`}
                  >
                    {method[0] !== null ? method[0] : null}
                  </span>

                  <strong className="p-4">{data[0]}</strong>
                  <span>{method[1].summary}</span>
                </div>
                <span>{pathSelected === i ? "-" : "+"}</span>
              </div>
              <div
                className={
                  pathSelected === i
                    ? `content show  ${setMethodColor(method[0], "300", "200")}`
                    : `content hide  ${setMethodColor(method[0], "300", "200")}`
                }
              >
                <div className="flex bg-white text-black p-4 shadow-md">
                  <div>{MYCONSTANT.PARAMETERS}</div>
                  <div
                    className="border-black border-2 p-1 rounded-sm"
                    onClick={() => getFlag()}
                  >
                    {flag ? MYCONSTANT.TRY : MYCONSTANT.CANCEL}
                  </div>
                </div>
                <div className="text-black px-2">
                  <table className="table-auto">
                    <thead>
                      <tr>
                        <th>{MYCONSTANT.NAME}</th>
                        <th>{MYCONSTANT.DESCRIPTION}</th>
                      </tr>
                    </thead>
                    <tbody>
                      {method[1].parameters.length <= 1 ? (
                        <tr>
                          <td>
                            <p>
                              <b>{method[1]?.parameters[0]?.name}</b>
                              <small className="text-red-900">
                                <sup>
                                  {method[1]?.parameters[0]?.name !== undefined
                                    ? MYCONSTANT.REQUIRED
                                    : null}
                                </sup>
                              </small>
                            </p>
                            &nbsp;
                          </td>
                          <td>
                            <small>{method[1]?.summary}</small>
                            <p>
                              <small>
                                {method[1]?.description === ""
                                  ? method[1]?.parameters[0]?.description
                                  : method[1]?.description}
                              </small>
                            </p>
                            {method[1]?.parameters[0]?.type ===
                              MYCONSTANT.STRING ||
                            method[1]?.parameters[0]?.type ===
                              MYCONSTANT.INTEGER ? (
                              <div>
                                <small>
                                  <input
                                    type="text"
                                    className="p-0"
                                    value={method[1]?.parameters[0]?.type}
                                    disabled="true"
                                  />
                                </small>
                              </div>
                            ) : method[1]?.parameters[0]?.type ===
                              MYCONSTANT.FILE ? (
                              <div>
                                <p>
                                  <small>
                                    <input
                                      type="file"
                                      className="p-0"
                                      id="file"
                                      name="file"
                                      accept="image/png, image/jpeg"
                                      disabled="true"
                                    />{" "}
                                  </small>
                                </p>
                              </div>
                            ) : method[1]?.parameters[0]?.type ===
                              MYCONSTANT.ARRAY ? (
                              <textarea
                                disabled="true"
                                value={Object.keys(method[1]?.parameters[0])}
                              ></textarea>
                            ) : (
                              <div>
                                <JSONPretty
                                  id="json-pretty"
                                  className="overflow-hidden"
                                  theme={JSONPrettyMon}
                                  data={method[1]?.parameters[0]}
                                ></JSONPretty>
                              </div>
                            )}
                          </td>
                        </tr>
                      ) : (
                        method[1].parameters.map((p) => (
                          <tr>
                            <td>
                              <small>
                                {p.name + " (" + p.type + ")"}
                                <small className="text-red-900">
                                  <sup>{MYCONSTANT.REQUIRED}</sup>
                                </small>
                              </small>
                              &nbsp;
                            </td>
                            <td>
                              <small>{method[1]?.summary}</small>
                              <p>
                                <small>{p.description}</small>
                              </p>
                              {p.type === MYCONSTANT.STRING ||
                              p.type === MYCONSTANT.INTEGER ? (
                                <div>
                                  <small>
                                    <input
                                      type="text"
                                      className="p-0"
                                      value={p.type}
                                      disabled="true"
                                    />
                                  </small>
                                </div>
                              ) : p.type === MYCONSTANT.FILE ? (
                                <div>
                                  <small>
                                    <input
                                      type="file"
                                      className="p-0"
                                      id="file"
                                      name="file"
                                      accept="image/png, image/jpeg"
                                      disabled="true"
                                    />{" "}
                                  </small>
                                </div>
                              ) : p.type === MYCONSTANT.BODY ? (
                                <div>
                                  <div className="border-2 border-black p-4">
                                    {""}
                                  </div>
                                </div>
                              ) : p.type === MYCONSTANT.ARRAY ? (
                                MYCONSTANT.ARRAY ? (
                                  <p>
                                    <textarea disabled="true"></textarea>
                                  </p>
                                ) : (
                                  ""
                                )
                              ) : (
                                ""
                              )}
                            </td>
                          </tr>
                        ))
                      )}
                    </tbody>
                  </table>
                </div>
                <div className="flex self-center bg-white text-black my-2 py-2">
                  <div className="m-auto ">
                    <p>{MYCONSTANT.PARAMETER_CONTENT_TYPE}</p>
                    <select className="w-46 border-solid border-2 border-zinc-500 ">
                      {method[1]?.produces.map((v, i) => (
                        <option onChange={changeResponse()} value={v} key={i}>
                          {v}
                        </option>
                      ))}
                    </select>
                  </div>
                </div>

                <div className="flex text-black mt-8 p-4">
                  <div>{MYCONSTANT.RESPONSE} </div>
                  <div className="">
                    {MYCONSTANT.RESPONSE_CONTENT_TYPE}
                    <select className="w-46 border-solid border-2 border-zinc-500 ">
                      {method[1]?.produces.map((v, i) => (
                        <option value={v} key={i}>
                          {v}
                        </option>
                      ))}
                    </select>
                  </div>
                </div>
                <div className="text-black p-2">
                  <table className="table-auto w-100">
                    <thead className="border-collapse">
                      <tr>
                        <th>{MYCONSTANT.CODE}</th>
                        <th>{MYCONSTANT.DESCRIPTION}</th>
                      </tr>
                    </thead>
                    <tbody>
                      {Object.entries(method[1]?.responses).map((v, i) =>
                        v.map((d, j) => (
                          <tr>
                            <td>{d.description ? v[0] : ""} &nbsp;</td>
                            <td>{d.description}</td>
                          </tr>
                        ))
                      )}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          ) : null
        )
      )}
    </>
  );
}
